DROP TABLE IF EXISTS `player`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `player` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `nick` varchar(1000) NOT NULL DEFAULT '' COMMENT '玩家名',
  `account_id` varchar(50) NOT NULL DEFAULT '0' COMMENT '平台账号ID',
  `account_name` varchar(50) NOT NULL DEFAULT '' COMMENT '平台账号',
  `account_type` varchar(50) NOT NULL COMMENT '平台类型,0 快速，1 注册,5以上为各个SDK',
  `client_id` varchar(50) NOT NULL DEFAULT '0' COMMENT '渠道ID',
  `platform` varchar(50) DEFAULT NULL COMMENT '所属平台，记录SDK platform_id',
  `device` varchar(50) DEFAULT NULL COMMENT '后登录设备端，可选值如下： android| ios | web | pc',
  `did` varchar(100) DEFAULT NULL COMMENT '设备ID',
  `phone` varchar(50) DEFAULT NULL COMMENT '绑定手机号',
  `sex` tinyint(4) DEFAULT '0' COMMENT '性别 1男 2 女 ',
  `type` smallint(5) NOT NULL DEFAULT '1' COMMENT '玩家身份1普通玩家2新手指导员',
  `facelook` varchar(1000) DEFAULT NULL,
  `reg_time` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '注册时间',
  `online_time` int(11) NOT NULL DEFAULT '0' COMMENT '在线总时间',
  `last_logout_time` int(11) NOT NULL DEFAULT '0' COMMENT '上次退出游戏时间',
  `last_login_time` int(11) NOT NULL DEFAULT '0' COMMENT '最后登陆时间',
  `reg_ip` varchar(20) NOT NULL DEFAULT '' COMMENT '注册IP',
  `last_login_ip` varchar(20) NOT NULL DEFAULT '' COMMENT '最后登陆IP',
  `gender` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '性别  0女 1男',
  `gold` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '钻石',
  `coin` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '金币',
  `lottery` bigint(20) DEFAULT '0' COMMENT '奖券',
  `rmb` int(11) DEFAULT '0' COMMENT '人民币',
  `feel` varchar(100) DEFAULT NULL COMMENT '心情',
  `delivery_name` varchar(50) DEFAULT NULL COMMENT '名字',
  `delivery_phone` bigint(20) DEFAULT NULL,
  `delivery_address` varchar(200) DEFAULT NULL COMMENT '地址',
  `vip` smallint(5) NOT NULL DEFAULT '0' COMMENT 'VIP等级，0不是VIP，1为VIP1，以此类推',
  `level` smallint(5) unsigned NOT NULL DEFAULT '1' COMMENT '等级',
  `exp` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '经验',
  `ban` blob NOT NULL COMMENT '是否封号',
  `other` blob NOT NULL COMMENT '其他信息',
  `total_recharge_rmb` bigint(22) NOT NULL DEFAULT '0' COMMENT '累计充值RMB数量(分)',
  `total_withdraw` bigint(20) DEFAULT '0' COMMENT '总共提现',
  `total_income` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '总收益',
  `total_use` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '总产出',
  `total_up_coin` bigint(20) DEFAULT '0' COMMENT '总上分',
  `total_down_coin` bigint(20) DEFAULT '0' COMMENT '总下分',
  `today_up_coin` bigint(20) DEFAULT '0' COMMENT '今天上分',
  `today_down_coin` bigint(20) DEFAULT '0' COMMENT '今天下分',
  `today_recharge` bigint(20) DEFAULT '0' COMMENT '今天充值',
  `today_withdraw` bigint(20) DEFAULT '0' COMMENT '今日提现',
  `today_stake` bigint(20) DEFAULT '0' COMMENT '今日押注',
  `today_output` bigint(20) DEFAULT '0' COMMENT '今日产出',
  `total_stake` bigint(20) DEFAULT '0' COMMENT '总押注 ',
  `total_output` bigint(20) DEFAULT '0' COMMENT '总产出',
  `time_long` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '总时长',
  `subgame` blob COMMENT '子游戏信息',
  `counter` longblob COMMENT '各种计数信息',
  `days` int(5) NOT NULL DEFAULT '0' COMMENT '天数',
  `daily_counter` longblob COMMENT '每日计数信息',
  `forbid_chat` blob COMMENT '禁言',
  `activity` blob COMMENT '活动',
  `client_version` varchar(20) DEFAULT NULL COMMENT '客户端版本号',
  `last_charge_time` bigint(20) DEFAULT '0' COMMENT '最近一次充值时间',
  `seq` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '序列号-防止写入冲突',
  `water` int(5) NOT NULL DEFAULT '0' COMMENT '水池',
  `set_water` int(5) NOT NULL DEFAULT '0' COMMENT '设置水池',
  `acc_water` int(5) NOT NULL DEFAULT '0' COMMENT '累计保护值',
  `last_set_water_time` int(5) NOT NULL DEFAULT '0' COMMENT '最后一次设置时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`) USING BTREE,
  KEY `level` (`level`) USING BTREE,
  KEY `account_name` (`account_name`) USING BTREE,
  KEY `last_login_time` (`last_login_time`) USING BTREE,
  KEY `reg_time` (`reg_time`) USING BTREE,
  KEY `gold` (`gold`) USING BTREE,
  KEY `account_id` (`account_id`) USING BTREE,
  KEY `water` (`water`)
) ENGINE=InnoDB AUTO_INCREMENT=1000019 DEFAULT CHARSET=utf8 COMMENT='角色基本信息';
